import React from "react";
import pencillImg from "../images/pencill.svg";
import Card from "./Card";

function Main({
  onEditAvatar,
  onEditProfile,
  onAddPlace,
  cards,
  onCardClick,
  CurrentUserContext,
  handleCardLike,
  onCardDelete,
}) {
  return (
    <main className="main">
      <section className="profile">
        {/* ... */}

        <button
          className="profile__button-add"
          type="button"
          aria-label="Добавить"
          onClick={onAddPlace}
        ></button>
      </section>
      <section className="mesta">
        {cards.length > 0 ? (
          cards.map((card) => (
            <Card
              card={card}
              onCardClick={onCardClick}
              onCardLike={handleCardLike}
              onCardDelete={onCardDelete}
              key={card?._id}
            />
          ))
        ) : (
          <p>No cards to display</p>
        )}
      </section>
    </main>
  );
}

export default Main;
